Anticipating that traders are inclined to modify their leverage strategies in response to heightened liquidation risks under increased price volatility of the underlying asset, this study incorporates an analysis of leverage adjustments. Research focusing on centralized exchanges (CEXs) often omits leverage considerations due to the general unavailability of such data. ${ }^{20,22}$ However, leveraging transaction-level data from GMX and GNS, this investigation calculates and integrates the daily average leverages for both long and short positions into the analytical framework. This is achieved by adapting the existing volatility estimation model, as delineated in Equation (2):

$$
\begin{gathered}
\hat{\sigma}_{t}=\mu+\sum_{i=1}^{m} \phi_{i} \hat{\sigma}_{t-i}+\sum_{j=1}^{3} \alpha_{j} E A_{j, t}+\sum_{j=1}^{3} \beta_{j} U A_{j, t}+\sum_{k=1}^{2} \gamma_{k} E L_{k, t}+ \\
\sum_{j=k}^{2} \lambda_{j} U L_{k, t}+\sum_{k=1}^{2} \rho_{k} E L V_{k, t}+\sum_{k=1}^{2} \omega_{k} U L V_{k, t}+\varepsilon_{t}
\end{gathered}
$$

where $E L V_{k, t}$ and $U L V_{k, t}$ denote expected and unexpected average leverage for long $(k=1)$ and short positions $(k=2)$, respectively, on day $t$. Notably, due to the cross-margining feature in Perpetual Protocol v2, where a collective pool of funds backs each position, ${ }^{5}$ the specific leverage level for each position remains undefined. Consequently, the leverage analysis using Equation (3) is confined to perpetual futures from GMX and GNS.
